        return (
            <SubmitCon>
                <Submit_text>
                    <Submit_text1>Subscribe Our Newsletter</Submit_text1>
                    <Submit_text2> Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rem, voluptate odio! Ipsum itaque rem impedit sunt! Nulla ea consequuntur tempora! 
